import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { UserProvider } from './usercontext';
import Home from './pages/Home';
import Cart from './pages/Cart';
import Shop from './pages/Shop';
import LogIn from './pages/LogIn';
import SignUp from './pages/SignUp';
import Profile from './pages/Profile';
import './App.css';

function App() {
  return (
      <>

      <UserProvider>
        <Routes>

          <Route path='/Cart' element={<Cart
          head="No Orders!"
          para="Welcome to our premier e-commerce destination, where shopping is transformed into an exceptional experience. With an extensive selection of top-quality products, a user-friendly interface, and a commitment to security, we offer a seamless shopping journey. Our dedicated customer service, swift shipping, and exclusive discounts ensure you receive the best value. Join our vibrant community of shoppers and discover why we're the go-to choice for online retail."
          />}/>
          <Route path='/Home' element={<Home
           headpara="Introducing Sale Sphere, a cutting-edge e-commerce platform that delivers numerous types of products directly to your doorstep."
           head="Welcome to Sale Sphere." 
           headtwo="A better way to shop anywhere on Earth."
           headtwopara="This website offers you an elevated and more convenient shopping experience, allowing you to browse and make purchases with greater ease and satisfaction."
           btn="Shop"
           midscript="Up For Some Shopping?"
           moonscript="You have the power to place orders right from the moon's serene surface, adding a touch of celestial wonder to your shopping experience."
           />}/>
          <Route path='/Shop' element={<Shop/>}/>
          <Route path='/SignUp' element={<SignUp/>}/>
          <Route path='/Profile' element={<Profile/>}/>
          <Route path='/' element={<LogIn/>}/>
        </Routes>
      </UserProvider>  

      </>
  );
}

export default App;
